import { Route, Link, Switch } from "react-router-dom";
import React, { useState, useEffect } from "react";
import "./App.css";
import NavBar from "./components/Nav";
import Home from "./components/Home";

function App() {
	return (
		<div className="App">
			<header>
				<NavBar />
			</header>
			<Switch>
				<Route path="/" exact>
					<Home />
				</Route>
			</Switch>

			<footer></footer>
		</div>
	);
}

export default App;
